function StreamLightingPacketChanneled(packetNumber, count, data, channel)
{
    var packet = [];
    packet[0] = 0x22;
    packet[1] = 0x10 | packetNumber;
    packet[2] = 0x01 << channel;
    packet[3] = 0x00;
    packet = packet.concat(data);

    device.write(packet,64);
    device.read(packet,64);
}

function SubmitLightingColors(channel)
{
    var packet = [];
    packet[0] = 0x22;
    packet[1] = 0xA0;
    packet[2] = 1 << channel;
    packet[3] = 0x00;
    packet[4] = 0x01;
    packet[5] = 0x00;
    packet[6] = 0x00;
    packet[7] = 0x28;
    packet[8] = 0x00;
    packet[9] = 0x00;
    packet[10] = 0x80;
    packet[11] = 0x00;
    packet[12] = 0x32;
    packet[13] = 0x00;
    packet[14] = 0x00;
    packet[15] = 0x01;
    device.write(packet,64)
}
