function hexToRgb(hex) {
    var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
    var colors = [];
    colors[0] = parseInt(result[1], 16);
    colors[1] = parseInt(result[2], 16);
    colors[2] = parseInt(result[3], 16);

    return colors;
  }
  
function SendChannel(channel,shutdown = false)
{

    var RGBdata = [128];

    var TotalLedCount = 0;
    var propertyArray = [device1, device2,device3,device4,device5,device6,device7,device8,device9,device10,device11,device12];


    for (var deviceNumber = 0+6*channel; deviceNumber < 6+6*channel; deviceNumber++ ) {

             if(deviceValues[deviceNumber] != "None"){

                for(var iIdx = 0; iIdx < DeviceDict[propertyArray[deviceNumber]].mapping.length; iIdx++){
                    var iPxX = DeviceDict[propertyArray[deviceNumber]].positioning[iIdx][0];
                    var iPxY = DeviceDict[propertyArray[deviceNumber]].positioning[iIdx][1];
                    var mxPxColor;
                    //find colors
                    if(shutdown){
                        mxPxColor = hexToRgb(shutdownColor)
                    }else if (LightingMode == "Forced") {
                        mxPxColor = hexToRgb(forcedColor)
                    }else{
                        mxPxColor = device.subdeviceColor(deviceArray[deviceNumber],iPxX, iPxY);
                    } 
                     //set colors
                     RGBdata[DeviceDict[propertyArray[deviceNumber]].mapping[iIdx]*3+TotalLedCount] = mxPxColor[1];
                     RGBdata[DeviceDict[propertyArray[deviceNumber]].mapping[iIdx]*3+TotalLedCount+1] = mxPxColor[0];
                     RGBdata[DeviceDict[propertyArray[deviceNumber]].mapping[iIdx]*3+TotalLedCount+2] = mxPxColor[2];
                    }
                    TotalLedCount += DeviceDict[propertyArray[deviceNumber]].ledCount*3;

                }
            
    }

     var packetNumber = 0;
     var TotalLedCount = TotalLedCount >= 120 ? 120 : TotalLedCount;

      while(TotalLedCount > 0){
          var ledsToSend = TotalLedCount >= 60 ? 60 : TotalLedCount;

          StreamLightingPacketChanneled(packetNumber,ledsToSend,RGBdata.splice(0,ledsToSend),channel);

          packetNumber += 1;
          TotalLedCount -= ledsToSend;
      }
      SubmitLightingColors(channel);
}

export function Render()
{

        SendChannel(0);
        SendChannel(1);
        InitCustomStrip();
        SetFans();
}

 
